import DirectionsRunIcon from '@mui/icons-material/DirectionsRun';
import FitnessCenterIcon from '@mui/icons-material/FitnessCenter';
import SchoolIcon from '@mui/icons-material/School';
import SentimentSatisfiedAltIcon from '@mui/icons-material/SentimentSatisfiedAlt';
import { Card, CardContent, Icon, Typography } from '@mui/material';
import React from 'react';
import './StatTracker.css';

const StatTracker = ({ stats }) => {
    return (
        <Card className="stat-tracker-card">
            <CardContent>
                <Typography variant="h6" className="stats-title">Stats:</Typography>
                <div className="stat">
                    <Icon><FitnessCenterIcon /></Icon>
                    <Typography className="stat-value">: {stats.strength}</Typography>
                </div>
                <div className="stat">
                    <Icon><DirectionsRunIcon /></Icon>
                    <Typography className="stat-value">: {stats.agility}</Typography>
                </div>
                <div className="stat">
                    <Icon><SchoolIcon /></Icon>
                    <Typography className="stat-value">: {stats.intelligence}</Typography>
                </div>
                <div className="stat">
                    <Icon><SentimentSatisfiedAltIcon /></Icon>
                    <Typography className="stat-value">: {stats.happiness}</Typography>
                </div>
            </CardContent>
        </Card>
    );
}

export default StatTracker;
